import { Routes, Route, Navigate } from "react-router-dom";
import MealGenerator from "./pages/MealGenerator";
import CalorieEstimator from "./pages/CalorieEstimator";
import WorkoutPlanner from "./pages/WorkoutPlanner";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Navbar from "./components/Navbar";
import { useAuth } from "./context/AuthContext";

const App = () => {
  const { user } = useAuth();

  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={user ? <MealGenerator /> : <Navigate to="/login" />} />
        <Route path="/calorie" element={user ? <CalorieEstimator /> : <Navigate to="/login" />} />
        <Route path="/workout" element={user ? <WorkoutPlanner /> : <Navigate to="/login" />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </>
  );
};

export default App;
